import React from 'react';
import myntraLogo from './myntra.svg';
import './App.css';

function App() {
  return (
    <>
      <nav className="navbar navbar-expand-lg navbar-light bg-dark">
        <a className="navbar-brand" href="#">
          <img src={myntraLogo} width="30" height="30" alt="Myntra Logo"/>
        </a>
        <div className="collapse navbar-collapse" id="navbarNavAltMarkup">
          <div className="navbar-nav">
            <a className="nav-item nav-link active mx-2 text-white" href="#">Home</a>
            <a className="nav-item nav-link active mx-2 text-white" href="#">About Us</a>
            <a className="nav-item nav-link active mx-2 text-white" href="#">Contact Us</a>
          </div>
          <button className="btn btn-outline-success my-2 my-sm-0 ml-auto" type="submit">Work with me</button>
        </div>
      </nav>
    </>
  );
}

export default App;
